import { environment } from 'src/environments/environment';
const BASEURL = environment.baseUrl;


export const endPoints = {
  users:{
    signup:`${BASEURL}/sign-up`,
    login:`${BASEURL}/admin/student-login`,
    profile:`${BASEURL}/admin/profile`,
    updateProfile:`${BASEURL}/admin/profile_update`,
    postTrip:`${BASEURL}/admin/post_trip`,
    getTrips:`${BASEURL}/admin/post_trips`,

  },

  data:{
    countries:`${BASEURL}/admin/countries`,
    cities:`${BASEURL}/admin/cities`,
    universities:`${BASEURL}/admin/universities`
  },
  buddies:{
    findBuddies:`${BASEURL}/admin/find_buddies`,
  },

  chat:{
    sendRequest:`${BASEURL}/admin/message_request`,
    getRequests:`${BASEURL}/admin/message_request_list`,
    getContacts:`${BASEURL}/admin/my_request_list`,
    acceptRejectReq:`${BASEURL}/admin/approve_reject`,
    sendMessage:`${BASEURL}/admin/send_message`,
    getMessages:`${BASEURL}/admin/messages_details`,
    messageDetails:`${BASEURL}/admin/messages_details`,
  },

};
